import React, { useState } from "react";
import Modal from "react-modal";
import ShoppingCartOutlinedIcon from "@material-ui/icons/ShoppingCartOutlined";
import SearchOutlinedIcon from "@material-ui/icons/SearchOutlined";
import { useNavigate } from "react-router-dom";
import axios from "axios"; // Import Axios

import "../../components/header/headerPrimary.css";

const baseURL = "http://localhost:14440/ashram/api/auth/v1";

function HeaderPrimary() {
  const navigate = useNavigate();
  const [isSignupModalOpen, setSignupModalOpen] = useState(false);
  const [isLoginModalOpen, setLoginModalOpen] = useState(false);
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    username: "",
    userid: "",
    mobile: "",
    gender: "",
    profession: "",
    address: "",
    resetToken: "",
  });

  const openSignupModal = () => {
    setSignupModalOpen(true);
  };

  const closeSignupModal = () => {
    setSignupModalOpen(false);
  };

  const openLoginModal = () => {
    setLoginModalOpen(true);
  };

  const closeLoginModal = () => {
    setLoginModalOpen(false);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSignup = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`${baseURL}/registeruser`, formData);
      // Handle successful signup
      console.log("Signup successful", response.data);
    } catch (error) {
      // Handle signup error
      console.error("Signup error", error);
    }
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`${baseURL}/loginuser`, formData);
      // Handle successful login
      console.log("Login successful", response.data);
    } catch (error) {
      // Handle login error
      console.error("Login error", error);
    }
  };

  return (
    <div className="headerPrimary">
      <div className="left part">
        <div>
          <h3>Valmiki</h3>
        </div>
      </div>
      <div className="mid part">
        <div className="searchIcon">
          <SearchOutlinedIcon className="icon" />
        </div>
        <input className="searchBar" placeholder="Search for anything"></input>
      </div>
      <div className="right part">
        <div className="businessDiv" style={{ cursor: "pointer" }}>
          Coding Platform
        </div>
        <div className="teachDiv" style={{ cursor: "pointer" }}>
          Teach On Valmiki
        </div>
        <div className="cartDiv">
          <ShoppingCartOutlinedIcon className="icon" />
        </div>
        <div className="login button" onClick={openLoginModal}>
          Login
        </div>

        <Modal
          isOpen={isLoginModalOpen}
          onRequestClose={closeLoginModal}
          contentLabel="Login Modal"
        >
          {/* Your login modal content */}
          <div>
            <h1>Login</h1>
            <form onSubmit={handleLogin}>
              <input
                type="email"
                name="email"
                placeholder="Email"
                value={formData.email}
                onChange={handleInputChange}
                required
              />
              <input
                type="password"
                name="password"
                placeholder="Password"
                value={formData.password}
                onChange={handleInputChange}
                required
              />
              <button type="submit">Login</button>
            </form>
          </div>
        </Modal>

        <div className="signup button" onClick={openSignupModal}>
          Sign up
        </div>

        <Modal
          isOpen={isSignupModalOpen}
          onRequestClose={closeSignupModal}
          contentLabel="Sign Up Modal"
        >
          {/* Your signup modal content */}
          <div>
            <h1>Sign Up</h1>
            <form onSubmit={handleSignup}>
              <input
                type="email"
                name="email"
                placeholder="Email"
                value={formData.email}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="username"
                placeholder="Username"
                value={formData.username}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="userid"
                placeholder="UserID"
                value={formData.userid}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="mobile"
                placeholder="Mobile"
                value={formData.mobile}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="gender"
                placeholder="Gender"
                value={formData.gender}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="profession"
                placeholder="Profession"
                value={formData.profession}
                onChange={handleInputChange}
                required
              />
              <input
                type="text"
                name="address"
                placeholder="Address"
                value={formData.address}
                onChange={handleInputChange}
                required
              />
              <input
                type="password"
                name="password"
                placeholder="Password"
                value={formData.password}
                onChange={handleInputChange}
                required
              />
              <button type="submit">Sign Up</button>
            </form>
          </div>
        </Modal>
      </div>
    </div>
  );
}

export default HeaderPrimary;
